import React from "react";

const Search = () => (
  <div className="text-center hero my-5">

    <p className="lead">
      This is an application that will help you to grow plants easily and efficiently
    </p>
    <p className="next line">
      Will add items you can choose from or categories you can choose from
    </p>
  </div>
);

export default Search;
